Here is a simple C code to add two integers:

```c
#include <stdio.h>

int main() {
    int a, b, sum;

    printf("Enter first integer: ");
    scanf("%d", &a);

    printf("Enter second integer: ");
    scanf("%d", &b);

    sum = a + b;

    printf("Sum = %d\n", sum);

    return 0;
}
```

This program prompts the user to enter two integers, adds them together, and then displays the result.
